import { StyleSheet } from "react-native";
const styles=StyleSheet.create({
    header:{
        fontSize:23,
        color:"red",
        width:'100%',
        textAlign:"center"
    },
    child:{
        alignContent:"center",
        display:"flex",
        flexDirection:"row"
    }
});

export default styles;
